// 輸入存在兩個元素的陣列，並輸出兩個元素交換的陣列
// ex:
// input: [1, 4]
// output: [4, 1]
function q1(input){
    let temp = input[0]
    input[0] = input[1]
    input[1] = temp

    return input
}

console.log(q1([1,4]));


